import React from "react"
import Header from "../components/header"
import { motion } from "framer-motion"
import Arrow from "../components/arrows"
import Tagline from "../components/misc/tagline"
const transition = { duration: 0.3, ease: [0.43, 0.013, 0.23, 0.96] }
const Home = () => {
  return (
    <motion.div
      exit={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      initial={{ opacity: 0 }}
      transition={transition}
    >
      <Header />
      <Arrow />
      <Tagline />
      <Priskategori />
      <TextBubbleLeft />
      <ScrollDetect>
        <Movie />
      </ScrollDetect>
      <ScrollDetect>
        <Sample />
      </ScrollDetect>

      <IconDisplayer />
    </motion.div>
  )
}

export default Home
